// import Profile from "./Profile"
import Card from "./Card";
import NewPost from "./NewPost";


function User() {
  return (
    <div>      
      <div className="flex items-center justify-center mt-8">
        <div className="py-8">
          <Card />
        </div>
        <div className="py-8">
          <NewPost />
        </div>
      </div>

    </div>
  );
}

export default User;
